import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import HomePage from './components/HomePage';
import MedicalRecordsList from './components/MedicalRecordsList';
import AddMedicalRecord from './components/AddMedicalRecord';
import PatientList from './components/PatientList';
import AddPatient from './components/AddPatientForm';
import EditPatient from './components/EditPatientForm';

const App = () => {
    return (
        <Router>
            <div>
                <nav style={{ padding: '20px', background: '#f4f4f4', display: 'flex', justifyContent: 'space-around' }}>
                    <Link to="/" style={{ textDecoration: 'none', color: '#333', fontSize: '18px' }}>Home</Link>
                    <Link to="/patients" style={{ textDecoration: 'none', color: '#333', fontSize: '18px' }}>Patients</Link>
                    <Link to="/add-patient" style={{ textDecoration: 'none', color: '#333', fontSize: '18px' }}>Add Patient</Link>
                    <Link to="/medical-records" style={{ textDecoration: 'none', color: '#333', fontSize: '18px' }}>Medical Records</Link>
                    <Link to="/add-record" style={{ textDecoration: 'none', color: '#333', fontSize: '18px' }}>Add Medical Record</Link>
                </nav>

                <Routes>
                    <Route path="/" element={<HomePage />} />
                    <Route path="/patients" element={<PatientList />} />
                    <Route path="/add-patient" element={<AddPatient />} />
                    <Route path="/edit-patient/:id" element={<EditPatient />} />
                    <Route path="/medical-records" element={<MedicalRecordsList />} />
                    <Route path="/add-record" element={<AddMedicalRecord />} />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
